import React from "react";
import './App.css';
import { Route,Routes,Link } from "react";
import Istriangle from "./Istriangle";
import Quize from "./Quize";
import Hypot from "./Hypot";
import Area from "./Area";


function App() {
  return (
    <div className="App">
     <div className="left-container">
      <span className="header">Fun With tri Angle</span>
      <div className="nav">
        <span>Select What you Like To Do</span>
        <Link to="/">
          <button> IS Triangle?</button>
        </Link>
        <Link to="/Quize">
          <button>Play Quize</button>
        </Link>
        <Link to="/hypot">
          <button> Find hypotenuse</button>
        </Link>
        <Link to="/Area">
          <button>Area OF Triangle</button>
        </Link>

      </div>
     </div>
     <Routes>
      <Route path="/" element={<Istriangle/>}/>
      <Route path="/Quize" element={<Quize/>}/>
      <Route path="/hypot" element={<Hypot/>}/>
      <Route path="/Area" element={<Area/>}/>
     </Routes>
    </div>
  );
}

export default App;
